import React from 'react';
import { Container } from './styles';

const Oneway = () => {
return (
	<Container>
		<Input placeholder="Select Origin" />
		<Input placeholder="Select Destination" />
		<Input placholder="Select date" />
		<Input placeholder="Select  Return date" />
	</Container>
  )
}
export default Oneway ;
